#ad Braum’s An Affair of the Heart 🩷 Oklahoma’s largest and longest running shopping event features hundreds of artists, makers and small business owners from across the country who come to Oklahoma to set up their pop-up shops. 

@aaoth will be at the OKC Fairgrounds October 20-22nd and at @exposquareofficial in Tulsa November 17-19th. Visit aaoth.com for more info 🎟️

